              <input
                name="emailOrUsername"
                type="text"
                value={this.state.emailOrUsername}
                onChange={this.handleInputChange}
              />
              </hr>

              <br/>
              <br/>
              <br/>
              <br/>

              <center/>
            </label>

            <label>
              Password
              <input
                name="password"
                type="password"
                value={this.state.password}
                onChange={this.handleInputChange}
              />
              <br/>
              <br/>
              <br/>
              <br/>

              <center/>
            </label>

            <button type="submit">Log in</button>

          </form>
        </div>
      );
    }
} export default LoginForm;
